import React from "react";
import styled from "@emotion/styled";

import SliderContent from "./SliderContent";
import "../styles/Specialty.css";

const Specialty = () => {
  const SpecialtyCSS = css`
    position: relative;
    height: 400px;
    width: 100%;
    margin: 0 auto;
    overflow: hidden;
  `;

  return <div css={SpecialtyCSS}></div>;
};

export default Specialty;
